import React from "react";
import Card from "./card/card";
import "./cards.css";

const Cards = ({ data }) => {
    const personageList = data.results;
    console.log(personageList);
    return (
        <div>
            {Array.isArray(data) ?
                data.map((element, index) => {
                  return <Card card={element}></Card>
              }) :null
            }
        </div>

    )

}
export default Cards;
